import React,{useState,useEffect} from 'react'

const Form = (props) => {

    const [name,setName]=useState(props.school.name)
    const [disc,setDisc]=useState(props.school.description)
    const [img,setImg]=useState(props.school.img_school)
    const [contact,setContact]=useState(props.school.description)
 

    return (
        <>
            {props.school ? (
                <div className='container'>
                <label className="form-label" htmlFor="name">Name :</label>
                <input class="form-control" type="text" id='name' value={name}/>
                <label className="form-label" htmlFor="img">Image :</label>
                <input class="form-control" type="text" id='img'value={img}/>
                <label className="form-label" htmlFor="disc">Discription :</label>
                <input class="form-control" type="text" id='disc'/>
                <label className="form-label" htmlFor="contact">Contact Info :</label>
                <input class="form-control" type="text" id='contact'/>
                </div>
            ) : null}
        </>
    )
}

export default Form
